import React , {useState} from 'react'
import { Navigate } from 'react-router-dom';

function Login () {

    const[cred, seCred] = useState({});
    const users=[
        {
            mail:"abc@abc.com",
            password:"abc",
        },
        {
            mail:"def@def.com",
            password:"def",
        },
    ]
    const handleLogin =()=>{
        //initializing credentialsMatched
        const credentialsMatched = users.find((item)=>
        {
            return item.mail === cred?.mail && item?.password === cred?.password;
        });
        //if true
        if(credentialsMatched){
            localStorage?.setItem("authToken", "dummyToken");
            Navigate("/home");
        }
    }
  return (
    <div>Login</div>
  )
}

export default Login
